import React from 'react';
import {Card, Button} from 'react-bootstrap';

const Item = (helado) => {
  let h = helado.helado;
  let id,img,nombre,stock;

  [id, img, nombre, stock] = [h.id, h.img, h.nombre, h.stock];
console.log(img,stock)
  return <>
    <Card style={{ width: '18rem' }}>
        <Card.Img variant="top" src={img} />
        <Card.Body>
            <Card.Title>{nombre}</Card.Title>
            <Card.Text> {stock ? 'En stock':'Sin stock'} </Card.Text>
            <Button variant="primary">Ver producto</Button>
        </Card.Body>
    </Card>
  </>;
};

export default Item;
